import React from "react";
import  "./footer.css"
import discord from '../../assets/img/discord.png';
import telegram from '../../assets/img/Telegram-logo.png';
import twitter from '../../assets/img/twitter.png';


const Footer = () => {
    return (
        <div className="footer" id="footer">
            <div className="title">
                <h2>Join The Community</h2>
            </div>
            <div className="section-footer">
            <img src={discord} alt="The Void logo" className="roadmap-image"></img>
            <img src={telegram} alt="The Void logo" className="roadmap-image"></img>
            <img src={twitter} alt="The Void logo" className="roadmap-image"></img>
            </div>
        </div>
    )
}

export default Footer
